export class DocumentError {
  constructor(error, secIndex, index) {
    this.error = error;
    this.secIndex = secIndex;
    this.index = index;
  }

  getError() {
    return this.error;
  }

  getSection() {
    return this.secIndex;
  }

  getIndex() {
    return this.index;
  }
}
